import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    return(
        <div>
            <div>
                <nav>
                    <h1>Dogger</h1>
                    <Link to='/login'></Link>
                </nav>
            </div>
        </div>
        
    );
}

export default Home;
